-- ----------------------------
-- Table structure for t_pcr_payjnl
-- ----------------------------
DROP TABLE IF EXISTS `t_pcr_payjnl`;
CREATE TABLE `t_pcr_payjnl`  (
  `REQ_SYS_CNL` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '请求系统渠道',
  `REQ_BUS_CNL` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '请求业务渠道',
  `REQ_BUS_NO` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '业务参考号',
  `REQ_JRN_NO` varchar(34) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易请求流水号',
  `PRD_NO` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '产品码',
  `TX_TYP` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易类型',
  `BUS_TYP` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '业务类型',
  `AC_SCE_CD` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '业务场景码',
  `TMPS_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ',
  `BUS_ORD_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '受理交易订单号',
  `BUS_ORD_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '受理交易日期',
  `ORD_TYP` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '订单类型',
  `ORD_AMT` decimal(18, 2) NOT NULL COMMENT '订单金额，如果对账交易取对账文件总金额',
  `EXP_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易过期日期',
  `EXP_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易过期时间',
  `BUS_INF` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '业务要素,json字符串形式存储业务记账要素',
  `HLD_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '冻结编号，存放支付核心发起冻结交易后账务系统返回冻结编号',
  `CCY` varchar(3) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '币种',
  `CAP_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '资金种类',
  `PRD_CLS` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '产品种类，参考商户管理分册数据字典6.3',
  `PAY_TOOL` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付工具参考商户管理数据字典6.4支付工具-PAY_TOOL',
  `PAY_USR_NO` bigint(20) NOT NULL DEFAULT 0 COMMENT '付款方用户号',
  `RCV_USR_NO` bigint(20) NOT NULL DEFAULT 0 COMMENT '收款内部用户号',
  `TX_AMT` decimal(18, 2) NOT NULL COMMENT '本次交易金额',
  `REG_MDL` varchar(3) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '登记模块：ACC账户交易；PPD银行实体账户入金；WDC银行实体账户出金',
  `PCR_JRN_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付核心系统流水号',
  `PCR_TX_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付核心交易日期',
  `PCR_TX_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付核心交易时间',
  `PCR_STS` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付核心交易状态,U初始化状态，交易过期后可以更新失败，P处理中，S成功，F失败',
  `PROC_TM` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '交易处理时间，毫秒',
  `MSG_CD` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易处理信息码',
  `MSG_INF` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易信息码对应描述信息',
  `AC_STS` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '记账状态U初始化  P处理中  S成功  F失败',
  `AC_RET_DATA` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '账务系统返回数据',
  `AC_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '账务系统返回会计日期',
  `SND_AC_JRN` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '外发账务流水号',
  `SPL_FLG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'N' COMMENT '补单标识(N:正常交易;S:补单交易)',
  `ORG_PCR_JRN` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '原支付核心流水号',
  `ORG_PCR_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '原请求交易日期',
  `ADM_RFD_AMT` decimal(18, 2) NULL DEFAULT NULL COMMENT '可退款金额',
  `RFD_FLG_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'N' COMMENT '标识本笔交易是否被冲正:N:正常 P：部分退款 R：全额退款',
  `RFD_JRN_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '退款流水号存在多次退款时，保留最近一笔',
  `RFD_TX_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'N' COMMENT '退款交易标志:N:正常 R:退款交易',
  `RVS_FLG_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'N' COMMENT '标识本笔交易是否被冲正:N:正常 R:被撤销',
  `RVS_JRN` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '撤销流水号',
  `RVS_TX_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'N' COMMENT '撤销交易状态:N:正常 R:撤销交易',
  `RSK_APPR_STS` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '风控审批状态0:不需要审批1:待风控审批2:风控审批通过3:风控拒绝4:风控法律冻结9:风控拒绝',
  `RSK_WARN_CD` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '风险警示代码',
  `RSK_WARN_RSN` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '风控警示原因',
  `RSK_APPR_OPR` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '风控审批操作员',
  `RSK_RMK` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '风控备注',
  `NOD_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易发生节点名',
  `RMK` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '备注',
  `TM_SMP` varchar(26) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '时间戳',
  PRIMARY KEY (`REQ_JRN_NO`, `REQ_SYS_CNL`) USING BTREE,
  UNIQUE INDEX `T_PCR_PAYJNL_UN1`(`PCR_JRN_NO`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '支付核心支付流水信息表，跟踪支付核心原子交易的生命周期' ROW_FORMAT = Dynamic;

-- ----------------------------
