-- ----------------------------
-- Table structure for t_pcr_ppdjnl
-- ----------------------------
DROP TABLE IF EXISTS `t_pcr_ppdjnl`;
CREATE TABLE `t_pcr_ppdjnl`  (
  `REQ_BUS_NO` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '业务参考号',
  `PPD_APL_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '充值申请金额,外部申请的金额，如消费卡的金额。对账应使用该字段。',
  `APL_RFD_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '申请退款金额',
  `FEE_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '手续费金额',
  `USR_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '用户类型:1个人用户 2 个人商户 5 企业用户 8 企业商户',
  `AC_PAY_FLG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '是否为系统内的用户标识 0：有账户支付1：无账户支付',
  `USR_NO` bigint(20) NOT NULL DEFAULT 0 COMMENT '内部用户号',
  `CCY` varchar(3) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '币种,	缺省人民币',
  `USR_IP_ADR` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '用户操作IP地址',
  `AGR_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '关联协议编号,对于绑定充值或快捷模式，需要传递原银行提供的绑定协议编号',
  `CAP_CORG` varchar(12) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '资金合作机构',
  `CRD_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '资金卡账户类型0：借记卡；1：信用卡；2：准贷记卡；3：储蓄账户；4：企业结算账户9: 未知',
  `PCR_JRN_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '充值内部订单号(申请时的流水号组成)',
  `PCR_TX_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付核心交易日期',
  `PCR_TX_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付核心交易时间',
  `PPD_STS` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT 'U初始化P处理中S成功F失败 ',
  `MSG_CD` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易处理信息码',
  `MSG_INF` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易信息码对应描述信息',
  `PROC_TM` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易处理时间，毫秒',
  `CRD_NO_CIPHER` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '资金卡账号,如果银行有返回卡号或账号',
  `CRD_NO_MASK` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '银行卡号（加掩码）',
  `MERC_ID` varchar(34) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户编码',
  `MERC_NM` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户名称',
  `GOODS_NM` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商品名称',
  `ORDR_DESC` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '订单的简要描述,商品名称',
  `RUT_CORG_SEP_CD` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '通道对应特征码',
  `CNL_TYP` varchar(3) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '通道类型',
  `COP_BUS_TYP` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '合作机构业务类型',
  `RUT_CORG` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '路径合作机构',
  `SMS_TOKEN` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '短信下发token',
  `OUT_REQ_JRN` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '外发请求流水号',
  `OUT_REQ_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '外发请求日期',
  `OUT_REQ_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '外发请求时间',
  `BPG_STS` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '金融合作平台返回状态',
  `BPG_TX_CD` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ',
  `CNL_JRN_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '通道流水号',
  `CNL_ORD_NO` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '通道订单号',
  `CNL_ORD_TM` varchar(26) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '通道受理时间',
  `ORG_BPG_JRN` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '原金融合作平台支付流水号',
  `ORG_PCR_JRN` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '原支付流水号',
  `RFD_TX_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '退款标识(N:正常交易;R:退货交易)',
  `RFD_MOD` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '退款方式 0 原路退回 1 银企出金付款  2转线下付款',
  `AC_TRS_JRN` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '账户交易流水号',
  `AC_TRS_SYS_CNL` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '账户交易系统渠道',
  `AFTER_BNK_ACC_FLG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '入金后记账标识 Y 需要 N不需要，默认不需要',
  `CHK_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '对账日期',
  `CHK_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '对账时间',
  `CHK_STS` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '对账状态',
  `NOD_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易发生节点名',
  `RMK` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '备注',
  `TM_SMP` varchar(26) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '时间戳',
  PRIMARY KEY (`PCR_JRN_NO`, `PCR_TX_DT`) USING BTREE,
  UNIQUE INDEX `T_PPD_ORDR_PK`(`PCR_JRN_NO`, `PCR_TX_DT`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '入金控制流水表' ROW_FORMAT = Dynamic;

