-- ----------------------------
-- Table structure for t_pcr_wdcbpsc
-- ----------------------------
DROP TABLE IF EXISTS `t_pcr_wdcbpsc`;
CREATE TABLE `t_pcr_wdcbpsc`  (
  `WC_BAT_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '出金付款内部批次号',
  `RUT_CORG` varchar(12) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '路径合作机构号',
  `CRE_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '建立日期',
  `CRE_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '建立时间',
  `WC_BAT_CNT` bigint(20) NOT NULL COMMENT '付款批次记录数',
  `WC_BAT_AMT` decimal(18, 2) NOT NULL COMMENT '付款批次金额',
  `WC_BAT_STS` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '付款批次状态[SU:未发送;SP:下游批次打包完成;ST:发送过程中;SS:已发送;SE:发送异常;SF:发送失败;QW:批次查询中;QD:批次不明;QS:批次明确;]',
  `WC_BAT_SUCC_CNT` bigint(20) NOT NULL DEFAULT 0 COMMENT '批次成功记录数',
  `WC_BAT_OUT` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '金融合作平台付款批次号',
  `AC_PRS_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '账务处理类型[B:批量记账;S:单笔记账;]',
